CREATE TABLE SubDistrito (
	ID_SubDistrito int IDENTITY (1, 1) NOT NULL,
	Descricao_SubDistrito varchar (MAX) NULL,
	Sigla_UF char (2) NULL,
	Situacao BIT NULL DEFAULT 1,
	DataInclusao DATETIME NULL DEFAULT GETDATE(),
	DataAlteracao DATETIME NULL,
	DataExclusao DATETIME NULL,
	CONSTRAINT PK_SubDistrito PRIMARY KEY (ID_SubDistrito),
	CONSTRAINT FK_SubDistrito_UF FOREIGN KEY (Sigla_UF) REFERENCES Unidades_Federacao(Sigla_UF)	
)
GO


SET IDENTITY_INSERT SubDistrito ON


SET IDENTITY_INSERT SubDistrito OFF
